import React, { useState, useEffect } from 'react';
import TinderCard from 'react-tinder-card';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const cuteAnimalEmojiMap = {
  "electrical engineering": "🐭",
  "mechanical engineering": "🐱",
  "civil engineering": "🐶",
  "chemical engineering": "🐹",
  "general engineering": "🐻",
  "computer science": "🦊"
};

const getEngineerEmoji = (user) => {
  if (user.major) {
    const normalizedMajor = user.major.trim().toLowerCase();
    return cuteAnimalEmojiMap[normalizedMajor] || "🐱";
  }
  return "🐱";
};

function MatchList({ userId }) {
  const [matches, setMatches] = useState([]);
  const [error, setError] = useState('');
  const [bottomMessage, setBottomMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    axios.get(`/api/matches/find/${userId}`)
      .then(response => {
        if (Array.isArray(response.data)) {
          setMatches(response.data);
          setError('');
        } else {
          setMatches([]);
          setError(response.data);
        }
      })
      .catch(err => {
        setError(err.response?.data || 'Error fetching matches');
        setMatches([]);
      });
  }, [userId]);

  const getUsername = (user) => {
    return user.name && user.name.trim() !== "" ? user.name : user.email.split('@')[0];
  };

  const onSwipe = (direction, matchUserId) => {
    if (direction === 'right') {
      axios.post(`/api/matches/swipe?user1Id=${userId}&user2Id=${matchUserId}`)
        .then(response => {
          setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
          setBottomMessage(response.data.message || '');
        })
        .catch(err => {
          setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
          setBottomMessage(err.response?.data || 'Error processing swipe.');
        });
    } else {
      setMatches(prev => prev.filter(match => match.user.id !== matchUserId));
      setBottomMessage('');
    }
  };

  const styles = {
    container: {
      maxWidth: '500px',
      margin: '2rem auto',
      padding: '2rem',
      backgroundColor: '#ffffff',
      boxShadow: '0 8px 16px rgba(0,0,0,0.1)',
      borderRadius: '16px',
      textAlign: 'center',
      color: '#333',
    },
    header: {
      marginBottom: '1rem',
      color: '#2c6e6a'
    },
    cardContainer: {
      position: 'relative',
      width: '100%',
      height: '520px',
      margin: '0 auto'
    },
    card: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      backgroundColor: '#f7f9fc',
      boxShadow: '0 6px 12px rgba(0,0,0,0.1)',
      borderRadius: '20px',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'space-between',
      padding: '1.5rem',
    },
    emoji: {
      fontSize: '5rem',
      marginBottom: '1rem'
    },
    username: {
      fontSize: '1.6rem',
      fontWeight: '600',
      color: '#2c6e6a',
      marginBottom: '0.5rem'
    },
    infoText: {
      fontSize: '0.95rem',
      margin: '0.25rem 0',
      color: '#555'
    },
    buttonContainer: {
      display: 'flex',
      justifyContent: 'space-between',
      marginTop: '1rem'
    },
    button: {
      padding: '10px 20px',
      fontSize: '1.2rem',
      color: '#fff',
      border: 'none',
      borderRadius: '30px',
      cursor: 'pointer',
      flex: 1,
      margin: '0 10px'
    },
    rejectButton: {
      backgroundColor: '#ff6b6b'
    },
    acceptButton: {
      backgroundColor: '#5ccdc1'
    },
    updateButton: {
      backgroundColor: '#5ccdc1',
      padding: '10px 20px',
      fontSize: '1rem',
      borderRadius: '20px',
      border: 'none',
      color: '#fff',
      cursor: 'pointer',
      marginBottom: '1rem'
    },
    message: {
      color: 'blue',
      marginTop: '1rem'
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>Find Your StudyBuds</h2>
      <button style={styles.updateButton} onClick={() => navigate('/update')}>
        Update Preferences
      </button>

      {error && <p style={styles.message}>{error}</p>}

      <div style={styles.cardContainer}>
        {matches.length > 0 ? matches.map((match) => (
          <TinderCard
            key={match.user.id}
            onSwipe={(dir) => onSwipe(dir, match.user.id)}
            preventSwipe={[]}
          >
            <div style={styles.card}>
              <div>
                <div style={styles.emoji}>{getEngineerEmoji(match.user)}</div>
                <div style={styles.username}>{getUsername(match.user)}</div>
                <div style={styles.infoText}>
                  <strong>Common Days: </strong>{match.commonDays.join(', ')}
                </div>
                <div style={styles.infoText}>
                  <strong>Subjects: </strong>{match.commonSubjects.join(', ')}
                </div>
              </div>
              <div style={styles.buttonContainer}>
                <button 
                  style={{...styles.button, ...styles.rejectButton}}
                  onClick={() => onSwipe('left', match.user.id)}
                >
                  ✖️
                </button>
                <button 
                  style={{...styles.button, ...styles.acceptButton}}
                  onClick={() => onSwipe('right', match.user.id)}
                >
                  ✔️
                </button>
              </div>
            </div>
          </TinderCard>
        )) : <p>No matches available.</p>}
      </div>

      {bottomMessage && <p style={styles.message}>{bottomMessage}</p>}
    </div>
  );
}

export default MatchList;
